import ExpneseItems from "./components/ExpenseItems";
function App() {
  const expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(2023, 8, 12)
    },
    {
      id: 'e2',
      title: 'New TV',
      amount: 785.22,
      date: new Date(2023, 7, 22)
    },
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 124.22,
      date: new Date(2023, 8, 5)
    },
    {
      id: 'e4',
      title: 'New Desk(Wooden)',
      amount: 455,
      date: new Date(2023, 8, 1)
    }
  ]
  return (
    <div >
      <h2>Let get going!</h2>
      <ExpneseItems 
      expense={expenses[0]} 
      ></ExpneseItems>

      <ExpneseItems 
      expense={expenses[1]} 
      ></ExpneseItems>

      <ExpneseItems 
      expense={expenses[2]} 
      ></ExpneseItems>

      <ExpneseItems 
      expense={expenses[3]} 
      ></ExpneseItems>

    </div>
  );
}

export default App;
